// src/components/LandingPage.js
import React from 'react';
import { Link } from 'react-router-dom';

const LandingPage = () => {
  return (
    <div>
      <h1>Welcome to the Landing Page</h1>
      <Link to="/admin-login">
        <button>Admin</button>
      </Link>
    </div>
  );
};

export default LandingPage;
